import React from 'react';
import ReactDOM from 'react-dom';
import CanvasComponent from './CanvasComponent';

function App() {
  return (
    <div className="App">
     <CanvasComponent/>
    </div>
  );
}

ReactDOM.render(<App />, document.getElementById('root')); // Renders the App component to the div with id 'root'

export default App;
